import Child from '../Child/Child';
export default class Parent extends Component {
    state={
       products:[
        {id:1,Name:'Nokia',category:'mobile',price:7000,onSale:true},
        {id:2,Name:'infinix',category:'mobile',price:4000,onSale:false},
        {id:3,Name:'Nokia',category:'mobile',price:17000,onSale:true},
        {id:4,Name:'Nokia',category:'mobile',price:7000,onSale:true},
        {id:5,Name:'Nokia',category:'mobile',price:7000,onSale:true},
       ]
    }
  render() {
    return (
      <>
   <div>Parent</div>
     <Child  productInfo={this.state}/>
      </>
    )
  }
}
